function truncate_table() {
    console.log('truncate_table')
    var u1 = new EWA_UrlClass(EWA.F.FOS["@SYS_FRAME_UNID"].Url);
    u1.AddParameter("ewa_action", "UAct0");
    u1.AddParameter("ewa_ajax", "json");

    var u = u1.GetUrl();
    $J(u, function(rst) {
        EWA.F.FOS['@SYS_FRAME_UNID'].Reload();
    });
}
